import React from 'react'
import kazak from "../logo/kazak.jpg"
import saat from "../logo/saat.jpg"
import gozluk from "../logo/gozluk.jpg"
import tisort from "../logo/tisort.jpg"
import pantalon from "../logo/pantalon.jpg"
import rp from "../logo/rp.jpg"

export const SomeData = [
    {
        title:"Kazak",
        link: "/Kazak",
        icon: <img alt="" style={{height:"100px",width:"100px"}} src={kazak}></img>
    },
    {
        title:"Saat",
        link: "/Saat",
        icon: <img alt="" style={{height:"100px",width:"100px"}} src={saat}></img>
    },
    {
        title:"Gözlük",
        link: "/Gözlük",
        icon: <img alt="" style={{height:"100px",width:"100px"}} src={gozluk}></img>
    },
    {
        title:"Tisört",
        link: "/Tisört",
        icon: <img alt="" style={{height:"100px",width:"100px"}} src={tisort}></img>
    },
    {
        title:"Pantalon",
        link: "/Pantalon",
        icon: <img alt="" style={{height:"100px",width:"100px"}} src={pantalon}></img>
    },
    {
        title:"RP",
        link: "/RP",
        icon: <img alt="" style={{height:"100px",width:"100px"}} src={rp}></img>
    },
]
